INSERT INTO wp_posts VALUES("868", "1", "2020-08-26 10:51:38", "2020-08-26 10:51:38", "<h1>HealthCare <br>Transformed by <br>Technology<br><br>GUIDE FOR MIGRANTS <br>TO USE MY HEALTH RECORD</h1>		
			<h1>Manage your health better</h1>		
			<figure><a href=\"http://13.54.232.172/faq/\" target=\"_blank\" rel=\"noopener noreferrer\"><img width=\"157\" height=\"169\" src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm00r.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://13.54.232.172/faq/\" target=\"_blank\" rel=\"noopener noreferrer\">What is My Health Records<br></a></h5>		
			<figure><a href=\"http://13.54.232.172/programs/\"><img width=\"157\" height=\"169\" src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm00r.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://13.54.232.172/programs/\">Guide to Using My Health Records<br></a></h5>		
			<figure><a href=\"http://13.54.232.172/programs/\"><img width=\"157\" height=\"169\" src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm00r.jpg\" alt=\"\" loading=\"lazy\" /></a></figure><h5><a href=\"http://13.54.232.172/programs/\">Manage your child\'s My Health Records</a></h5>		
			<h1>Starting with My Health Record</h1>		
		<h4>What is My Health Record?</h4>
My Health Record is a secure online summary of an individual’s health information and is available to all Australians. Healthcare providers authorised by their healthcare organisation can access My Health Record to view and add to their patient’s health information.
<br>
<button><a href=\"http://13.54.232.172/faq/\" type=\"button\">Learn More</a></button>		
										<img width=\"720\" height=\"358\" src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg 768w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-300x149.jpg 300w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1024x509.jpg 1024w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1536x764.jpg 1536w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-2048x1018.jpg 2048w\" sizes=\"(max-width: 720px) 100vw, 720px\" />											
										<img src=\"http://13.54.232.172/wp-content/uploads/elementor/thumbs/v2_qfm20t-scaled-ouj65aw9zn5etl7zcxkei0e2cyjg4m3miqja6tbqg0.jpg\" title=\"v2_qfm20t\" alt=\"v2_qfm20t\" />											
		<h4>Benefits of my Health Records</h4>
Coming from different backgrounds people are unaware of the benefits provided by MY HEALTH RECORDS.
<ol type=\"circle\">
 	<li>Over the web, through a desktop, tablet or mobile phone web browser.</li>
 	<li>Through hospital and practice-based clinical information systems that are My Health Record-ready.</li>
</ol>
<button><a href=\"http://13.54.232.172/faq/\">Learn More</a></button><h4>Guide to setup My Health Record account</h4>
Click the buttons below to see the details you will need to create an account for yourself and your family. Also learn about linking your child\'s account to yours. This feature gives you access to mange their details and appointments from your account.
<br/>
<button> <a href=\"http://13.54.232.172/programs/\">Guide to Setup Account</a></button>
