			<figure><img src=\"http://13.54.232.172/wp-content/uploads/elementor/thumbs/v2_qflzzf-ouj7txha6gdcrc06u6tactoezg6v6mwmcxw5nh9jrs.jpg\" title=\"v2_qflzzf\" alt=\"v2_qflzzf\" /></figure><h3>Understand and compare Vaccination schedule</h3>		
			<h2>Starting with My Health Record</h2>		
		<h4>What is My Health Record?</h4>My Health Record is a secure online summary of an individual’s health information and is available to all Australians. Healthcare providers authorised by their healthcare organisation can access My Health Record to view and add to their patient’s health information.		
										<img width=\"720\" height=\"358\" src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg 768w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-300x149.jpg 300w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1024x509.jpg 1024w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1536x764.jpg 1536w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-2048x1018.jpg 2048w\" sizes=\"(max-width: 720px) 100vw, 720px\" />											
										<img src=\"http://13.54.232.172/wp-content/uploads/elementor/thumbs/v2_qfm20t-scaled-ouj65aw9zn5etl7zcxkei0e2cyjg4m3miqja6tbqg0.jpg\" title=\"v2_qfm20t\" alt=\"v2_qfm20t\" />											
		<h4>Benefits of my Health Records</h4>
Coming from different backgrounds people are unaware of the benefits provided by MY HEALTH RECORDS.
<ol>
 	<li>Over the web, through a desktop, tablet or mobile phone web browser</li>
 	<li>Through hospital and practice-based clinical information systems that are My Health Record-ready.</li>
</ol><h4>Guide to setup My Health Record account</h4>
Click the buttons below to see the details you will need to create an account for yourself and your family. Also learn about linking your child\'s account to yours. This feature gives you access to mange their details and appointments from your account.		
										<img src=\"http://13.54.232.172/wp-content/uploads/elementor/thumbs/v2_qfm2ej-scaled-ouj94xf0iqhc68w0wgckzuo2z82fgzd7bfmqddqy00.jpg\" title=\"v2_qfm2ej\" alt=\"v2_qfm2ej\" />", "Home", "", "inherit", "closed", "closed", "", "868-revision-v1", "", "", "2020-08-26 12:09:49", "2020-08-26 12:09:49", "", "868", "http://13.54.232.172/868-revision-v1/", "0", "revision", "", "0");
