My Health Record is a secure online summary of an individual’s health information and is available to all Australians. Healthcare providers authorised by their healthcare organisation can access My Health Record to view and add to their patient’s health information.

<button>Learn More</button>

<img src=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg\" sizes=\"(max-width: 720px) 100vw, 720px\" srcset=\"http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-768x382.jpg 768w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-300x149.jpg 300w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1024x509.jpg 1024w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-1536x764.jpg 1536w, http://13.54.232.172/wp-content/uploads/2020/08/v2_qfm228-2048x1018.jpg 2048w\" alt=\"\" width=\"720\" height=\"358\" />
